   this.remove = function(id) {
      delete this.timeouts[id];
      delete this.intervals[id];
      delete this.items[id];
   };
   
   this.destroyAll = function() {
      for(var id in this.items) {
         this.stop(id);
      }
      this.timeouts = {};
      this.intervals = {};
      this.items = {};
   };
